//helpers ------------------------------------------------------------------------------------------------------------------

void waitForEnter()
{
    int keyboardOut=-1;
    while(keyboardOut != 90 ) // 90 corresponds to the enter key
    {
        keyboardOut=pollForKeyboardIn();
    }
}

int getNumOnes(int input)
 {
 	int numberOfOnes=0;
 	while(input) // only when input = all zeros will it stop
 	{
 		numberOfOnes+=(input&1); //either adds zero or a 1 to our numOfOnes
 		input=input>>1; //preforms LSR(?), im assuming input is binary and we manipulate it as such
 		//input/=10;//if input is binary but we can manipulate it like an int 
 	}
	*RLEDs=numberOfOnes;
 	return numberOfOnes;
 }


int pollForKeyboardIn()
 {
 	int input=-1;
 	volatile int *kbdPtr = (int*)0xFF200100;
      int RVALID, KbdData;
       
 	while(input==-1)
 	{
 		KbdData =*kbdPtr;
        RVALID= (KbdData & 0x8000);    // extract the RVALID field
        if (RVALID != 0) 
        {
            input = KbdData & 0xFF; //extract keyboard input value 
        }
 	}
 	return input; //passback input value
 }

void drawImage(int xPos, int yPos, int width, int height, uint8_t* image)
{    
    //set up parameters
    int arrayIndex = 0; //arrayIndex accesses the colours stored in the sprite array
    short int colour; //the current colour of the pixel we are drawing

    //draw image by calling plot_pixel
    for (int x = xPos; x < xPos+width; x++) //loop through all the x until we draw as wide as speecified 
    {
        for (int y = yPos; y < yPos+height; y++) //loop through all the y until we draw as tall as speecified 
        {
            colour = (image[arrayIndex+1] << 8) | image[arrayIndex]; //create a 16bit colour by "oring" 2 colours, this the way that images are stored initally
            plot_pixel(y, x, colour); //plot what we have
            arrayIndex += 2; //go to the next colour
        }
    }
}

void plot_pixel(int x, int y, short int colour)
{
    *(short int *)(pixel_buffer_start + (y << 10) + (x << 1)) = colour;
}

